package cc.surui.model;import javafx.beans.property.IntegerProperty;import javafx.beans.property.LongProperty;import javafx.beans.property.SimpleIntegerProperty;import javafx.beans.property.SimpleLongProperty;import javafx.beans.property.SimpleStringProperty;import javafx.beans.property.StringProperty;public class Ranking extends Persistent<Ranking> {	private IntegerProperty id;	private StringProperty keyword = new SimpleStringProperty();	private StringProperty storeId = new SimpleStringProperty();	private LongProperty productId = new SimpleLongProperty();	private IntegerProperty rank = new SimpleIntegerProperty();	private StringProperty date = new SimpleStringProperty();	@Override	public Integer getId() {		if (id != null) {			return id.get();		}		return null;	}	public void setId(Integer id) {		this.id = new SimpleIntegerProperty(id);	}	public String getKeyword() {		return keyword.get();	}	public void setKeyword(String keyword) {		this.keyword.set(keyword);	}	public String getStoreId() {		return storeId.get();	}	public void setStoreId(String storeId) {		this.storeId.set(storeId);	}		public Long getProductId() {		return productId.get();	}	public void setProductId(Long productId) {		this.productId.set(productId);	}	public Integer getRank() {		return rank.get();	}	public void setRank(Integer rank) {		this.rank.set(rank);;	}	public String getDate() {		return date.get();	}	public void setDate(String date) {		this.date.set(date);	}}